import React from 'react';
import { Jumbotron, Container } from 'reactstrap';


const Footer = () => {
    return(
        <div>              
            <footer className="bg-dark text-center fixed-bottom">              
                <a href="https://www.facebook.com/pauloteixeiraJS/" rel="noopener noreferrer" target="_blank"><img src="/facebook.png" alt="Facebook" className="facebook"/></a>
                <a href="https://www.instagram.com/paulotx.js/" rel="noopener noreferrer" target="_blank"><img src="/instagram.png" alt="Instagram" className="instagram"/></a>
                <a href="https://twitter.com/paulotx_js" rel="noopener noreferrer" target="_blank"><img src="/twitter.png" alt="Twitter" className="twitter"/></a>	                
            </footer>           
        </div>

    )
}

export default Footer;
